import {
  required,
  isEmail,
  composeValidators,
} from "../utils/formValidatorHelper";

const Contact = ({ setMessage }) => {
  const onSubmit = (values) => {
    setMessage(values);
  };

  return (
    <>
      <h1 className="f24 bold mt16 mb16">Contact Us</h1>
      <div className="r bs-3 bg-1 p20 mb20">
        <p className="mb16">CONTACT FORM</p>
      </div>
    </>
  );
};

export default connect(null, null)(Contact);
